description:
Verenigde Staten
Animatie / Fantasy
75 minuten
Het gaat om een remastered versie!!


geregisseerd door Clyde Geronimi, Wilfred Jackson en Hamilton Luske
met de stemmen van Kathryn Beaumont, Ed Wynn en Richard Haydn

De kleine Alice zit samen met haar kat onder een boom wat te soezen wanneer plots een aangekleed wit konijn voorbijstormt. 
Het beestje heeft blijkbaar haast en Alice gaat er achteraan. 
Ze valt in een diep konijnegat en dat is het begin van een reeks fantastische avonturen.


